@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATMResponse rdf:type owl:Class .
atm:MoneyDispensed rdf:type owl:Class .

atm:hasResponse rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:ATMResponse .

atm:hasMoneyDispensed rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATMResponse ;
    rdfs:range atm:MoneyDispensed .
